  [color=purple]All of the marines were wiped out![/color]


  In memoriam of our fallen soldiers:

  Donnie McGee, Zero Silver, Sienna Nightwish, Rioma, Hypogaea 'P'nut' Arachis, Marlo 'El Gato' Manardo, Rains of Fire, Grabs Beekus, Hazzy Licious, Irvine 'Danger' Riker.



  Medal Awards:

  Kimberly Hunt is awarded the Medal of valor: 'Sergeant Kimbery Hunt,


  For remaining behind in the area of operations to attempt the rescue of downed marines, willingly risking her own life in the effort. Her courage and devotion to her fellow Marines showed us what it truly means to be a soldier of the 2nd Batallion.


  Awarded by LtCol. Freya Locke on 09/26/2125. 2nd Company "Falling Falcons"  4th Battalion  3rd Regiment  4th Combat Division  United Nations Marine Corps'





